//能源平衡基础表接口
import request from '@/utils/request'; // 查询

export function query(query) {
  return request({
    url: "/ems/dtEnergyBalance",
    method: 'get',
    params: query
  });
} // 查询单个

export function queryItem(code) {
  return request({
    url: "/ems/dtEnergyBalance/".concat(code),
    method: 'get'
  });
} // 新增

export function create(data) {
  return request({
    url: "/ems/dtEnergyBalance",
    method: 'post',
    data: data
  });
} // 更新

export function update(code, data) {
  return request({
    url: "/ems/dtEnergyBalance/".concat(code),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteItems(data) {
  return request({
    url: "/ems/dtEnergyBalance",
    method: 'delete',
    data: data
  });
} //查询仪表接口

export function queryeQuipmentLedger() {
  return request({
    url: "/ems/modelDetail/modelList",
    method: 'get'
  });
}
